import React from 'react';
import {Row, Col, Container} from 'react-bootstrap';
const Home = () => {
    return (
    <>
        <Container className="bg-gray">
            <Row>
                <Col xs={12} md={6}>
                    <h1>Lorem Ipsum</h1>
                </Col>
            </Row>
        </Container>
    </>);
}
 
export default Home;
